import { combineReducers } from 'redux';
import authReducer from './authSlice'; // Correct path to the authSlice file
import expenseReducer from './dataSlice'; // Assuming dataSlice is defined in the same directory

const rootReducer = combineReducers({
  auth: authReducer,
  data: expenseReducer,
});

export default rootReducer;
